nt=0;\r\n		  	$(\'table.datatable\').datatable({\r\n			  	checkable: true,\r\n			  	checksChanged:function(event){\r\n				  	this.$table.find(\"tbody tr\").find(\"input#boxs\").removeAttr(\"name\");\r\n				  	var checkArray = event.checks.checks;\r\n				  	count = checkArray.length;\r\n				  	for(var i=0;i<count;i++){\r\n					  	this.$table.find(\"tbody tr\").eq(checkArray[i]).find(\"input#boxs\").attr(\"name\",\"_selects\");\r\n				  	}\r\n			  	}\r\n		  	});\r\n			$(\".input-group .input-group-addon\").each(function(item){\r\n				 $(this).removeClass(\"fix-border\").removeClass(\"fix-padding\");\r\n			});\r\n			\r\n			 $(\'.form-date\').datetimepicker({\r\n						language : \'zh-CN\',\r\n						weekStart : 1,\r\n						todayBtn : 1,\r\n						autoclose : 1,\r\n						todayHighlight : 1,\r\n						startView : 2,\r\n						minView : 2,\r\n						forceParse : 0,\r\n						format : \'yyyy-mm-dd\'\r\n					});\r\n						$(\'.form-datetime\').datetimepicker({\r\n						language : \'zh-CN\',\r\n						weekStart : 1,\r\n						todayBtn : 1,\r\n						autoclose : 1,\r\n						todayHighlight : 1,\r\n						startView : 2,\r\n						forceParse : 0,\r\n						showMeridian : 1,\r\n						format : \'yyyy-mm-dd hh:ii\'\r\n					});\r\n					$(\'.form-time\').datetimepicker({\r\n						language : \'zh-CN\',\r\n						weekStart : 1,\r\n						todayBtn : 1,\r\n						autoclose : 1,\r\n						todayHighlight : 1,\r\n						startView : 1,\r\n						minView : 0,\r\n						maxView : 1,\r\n						forceParse : 0,\r\n						format : \'hh:ii\'\r\n					});\r\n					$(\'.form-date-long-medium\').datetimepicker({\r\n						language : \'zh-CN\',\r\n						weekStart : 1,\r\n						todayBtn : 1,\r\n						autoclose : 1,\r\n						todayHighlight : 1,\r\n						startView : 1,\r\n						minView : 0,\r\n						maxView : 1,\r\n						forceParse : 0,\r\n						format : \'yyyy-mm-dd hh:ii\'\r\n					});\r\n					$(\'.form-date-long-long\').datetimepicker({\r\n						language : \'zh-CN\',\r\n						weekStart : 1,\r\n						todayBtn : 1,\r\n						autoclose : 1,\r\n						todayHighlight : 1,\r\n						startView : 1,\r\n						minView : 0,\r\n						maxView : 1,\r\n						forceParse : 0,\r\n						format : \'yyyy-mm-dd hh:ii:ss\'\r\n					});\r\n                                        \r\n				initOrderBy();\r\n				\r\n				$.formValidator.initConfig({			\r\n					debug : false,\r\n					onSuccess : function() {					\r\n				},\r\n				onError : function() {\r\n					alert(\"错误，请看提示\")\r\n				}\r\n			});\r\n		\r\n		});\r\n		\r\n	</script>\r\n</body>\r\n</html>', '55', '110', null, null, null, null, null, null, '1', 'Ryan Ouyang', 'Ryan Ouyang', 'Ryan Ouyang', '0', '0', null, '0', null, '0', '529614');
